const CoinDetails = ({location}) => {
    const coinDetails = location.state
    console.log('coinDetails', coinDetails)

  return (
    <div>
        {coinDetails ? (
                <div>
                    <h2>{coinDetails.name}</h2>
                    <p>Symbol: {coinDetails.exp.symbol}</p>
                    <p>Price: {coinDetails.exp.price}</p>
                    {/* Add other details you want to display */}
                </div>
            ) : (
                <p>Loading coin details...</p>
            )}
    </div>
  )
}

export default CoinDetails
